do</strong></em> pero con la diferencia que permite realizar cambios en el estado de los permisos dentro de los subgrupos, componentes y contenido.','/var/www/html/muserpol/language/es-ES/es-ES.lib_joomla.ini'),(1738,'JLIB_RULES_SETTING_NOTES_ITEM','Si cambia la configuracin, las modificaciones se aplicarn en este elemento. Note que:<br /><em><strong>Heredado</strong></em> quiere decir que, para determinar el estado del permiso, se tendr en cuenta lo que haya asignado desde la configuracin global, desde los grupos de nivel superior y desde la categora.<br /><em><strong>Denegado</strong></em> quiere decir que da igual como est configurado el estado de los permisos sobre esa accin desde la configuracin global, o desde los grupos de nivel superior, o desde la categora; es decir, al grupo al que le cambie el estado del permiso a \'Denegado\' desde este apartado, no podr realizar esa accin sobre este elemento (incluyendo a todos sus subgrupos, si tuviera).<br /><em><strong>Permitido</strong></em> quiere decir que el grupo al que le cambie el estado de la accin a \'Permitido\' desde aqu, podr realizar esa accin sobre este elemento (pero si esta configuracin entra en conflicto con lo asignado desde la configuracin global, o con lo asignado en los grupos de nivel superior, o con lo asignado desde la categora, la configuracin que aplique desde aqu no tendr efecto, y el conflicto ser indicado con un <em><strong>No permitido (heredado)</strong></em> debajo del estado de configuracin calculada).','/var/www/html/muserpol/language/es-ES/es-ES.lib_joomla.ini'),(1739,'JLIB_RULES_SETTINGS_DESC','Gestione la configuracin de privilegios para los grupos de usuarios de ms abajo. Revise las notas de la parte inferior.','/var/www/html/muserpol/language/es-ES/es-ES.lib_joomla.ini'),(1740,'JLIB_STEMMER_INVALID_STEMMER','Tipo de analizador lingstico invlido %s','/var/www/html/muserpol/language/es-ES/es-ES.lib_joomla.ini'),(1741,'JLIB_UNKNOWN','Desconocido','/var/www/html/muserpol/language/es