que corresponda. <br />6. El modo en el que se mostrarn las banderas o el nombre de los idiomas se define segn el orden establecido desde el \'Gestor de idiomas - Idiomas del contenido\'','/var/www/html/muserpol/language/es-ES/es-ES.mod_languages.ini'),(2149,'MOD_LANGUAGES','Selector de idioma','/var/www/html/muserpol/language/es-ES/es-ES.mod_languages.sys.ini'),(2150,'MOD_LANGUAGES_XML_DESCRIPTION','Este mdulo muestra una lista de los idiomas del contenido disponibles (tantos como haya definidos y publicados desde la pestaa \'Idiomas del contenido\' que hay en el \'Gestor de idiomas\') para poder cambiar entre ellos cuando uno lo desee y as poder usar Joomla! como un sitio de mltiples idiomas.<br />--El plugin \'Sistema - Filtro del idioma\' tiene que estar habilitado.--<br />Cuando se cambia de idioma y el elemento a mostrar en la pgina no tiene asociacin con otro elemento, el mdulo redirigir a la pgina de inicio del idioma seleccionado.<br />En otro caso, es decir, si el parmetro est configurado por el plugin del filtro de idiomas, se redirigir al elemento asociado para el idioma seleccionado. Despus de esto, la navegacin ser la definida para ese idioma.<br />Si el plugin <strong>\'Sistema - Filtro del idioma\'</strong> est deshabilitado podra ocasionar resultados no deseados.<br /><strong>Mtodo:</strong><br />1. Abrir por la pestaa \'Idiomas del contenido\' que hay en el gestor de idiomas y asegrese de que los idiomas que desea usar estn publicados y tienen un cdigo del idioma para la URL as como un prefijo para la imagen a usar desde el mdulo.<br />2. Crear una pgina de inicio para poder asignar un idioma al elemento del men y definindolo como pgina de inicio predeterminada para cada idioma del contenido que tenga publicado. <br /> 3. Despus de eso, puede asignar un idioma a cada artculo, categora, mdulo, canal electrnico o enlace web de Joomla.<br /> 4. Asegrese de que el mdulo est publicado y el plugin habilitado.<br /> 5. Cuando est usando elementos asociados, asegrese de que el mdulo se est mostrando en las correspondientes pginas.<br />6. La manera en la que se muestran las banderas o nombres del idioma se define con la ordenacin de los elementos disponible desde el \'Gestor de idiomas -Idiomas del contenido\'.<br ><br >Si se publica este mdulo, tambin se recomienda publicar el mdulo de la administracin \'Estado multiidioma\'.','/var/www/html/muserpol/language/es-ES/es-ES.mod_languages.sys.ini'),(2151,'MOD_LANGUAGES_LAYOUT_DEFAULT','Predeterminado','/var/www/html/muserpol/language/es-ES/es-ES.mod_languages.sys.ini'),(2152,'MOD_LOGIN','Datos de acceso','/var/www/html/muserpol/language/es-ES/es-ES.mod_login.ini'),(2153,'MOD_LOGIN_FIELD_GREETING_DESC','Mostrar u ocultar el texto breve de bienvenida.','/var/www/html/muserpol/language/es-ES/es-ES.mod_login.ini'),(2154,'MOD_LOGIN_FIELD_GREETING_LABEL','Mostrar bienvenida','/var/www/html/muserpol/language/es-ES/es-ES.mod_login.ini'),(2155,'MOD_LOGIN_FIELD_LOGIN_REDIRECTURL_DESC','Seleccione o cree la pgina a la que ser redirigido el usuario tras identificarse correctamente. Predeterminadamente mantendr la misma pgina.','/var/www/html/muserpol/language/es-ES/es-ES.mod_login.ini'),(2156,'MOD_LOGIN_FIELD_LOGIN_REDIRECTURL_LABEL','Redireccin de conexin','/var/www/html/muserpol/language/es-ES/es-ES.mod_login.ini'),(2157,'MOD_LOGIN_FIELD_LOGOUT_REDIRECTURL_DESC','Seleccione o cree la pgina a la que ser redirigido el usuario tras desconectarse. Predeterminadamente mantendr la misma pgina.','/var/www/html/muserpol/language/es-ES/es-ES.mod_login.ini'),(2158,'MOD_LOGIN_FIELD_LOGOUT_REDIRECTURL_LABEL','Redireccin de desconexin','/var/www/html/muserpol/language/es-ES/es-ES.mod_login.ini'),(2159,'MOD_LOGIN_FIELD_NAME_DESC','Muestra el nombre completo o el usuario tras identificarse','/var/www/html/muserpol/language/es-ES/es-ES.mod_login.ini'),(2160,'MOD_LOGIN_FIELD_NAME_LABEL','Mostrar nombre o usuario','/var/www/html/muserpol/language/es-ES/es-ES.mod_login.ini'),(2161,'MOD_LOGIN_FIELD_