tes de los aportes de sus afiliados activos y pasivos de la Polcia Boliviana, las inversiones que stos generasen y otros ingresos propos;</div>\\n</li>\\n<li style=\\\"text-align: justify;\\\">\\n<div>Invertir los recursos propios con los que cuenta la MUSERPOL de acuerdo a reglamento interno;</div>\\n</li>\\n<li style=\\\"text-align: justify;\\\">\\n<div>Otorgar el beneficio variable del Fondo de Retiro Policial Solidario en el marco del principio de solidaridad;</div>\\n</li>\\n<li style=\\\"text-align: justify;\\\">\\n<div>Otorgar el beeficio de Cuota Mortuoria y Auxilio Mortuorio a favor del sector activo y pasivo de la Polcia Boliviana, de acuerdo a reglamentos emitidos por MUSERPOL;</div>\\n</li>\\n<li>\\n<div style=\\\"text-align: justify;\\\">Pagar el Complemento Econmico al sector pasivo de la Polcia Boliviana, conforme al reglamento.</div>\\n</li>\\n</ul>\",\"alignment\":\"\",\"text_fontsize\":\"\",\"text_lineheight\":\"\",\"text_fontweight\":\"\",\"dropcap\":0,\"class\":\"\",\"global_background_type\":\"none\",\"global_background_gradient\":{\"color\":\"#00c6fb\",\"color2\":\"#005bea\",\"deg\":\"45\",\"type\":\"linear\"},\"global_use_overlay\":0,\"global_background_repeat\":\"no-repeat\",\"global_background_size\":\"cover\",\"global_background_attachment\":\"inherit\",\"global_user_border\":0,\"global_border_width\":\"\",\"global_border_radius\":0,\"global_margin\":{\"md\":\"0 0 30px 0\",\"sm\":\"0 0 20px 0\",\"xs\":\"0 0 10px 0\"},\"global_padding\":{\"md\":\"   \",\"sm\":\"   \",\"xs\":\"   \"},\"global_boxshadow\":\"0 0 0 0 #ffffff\",\"global_use_animation\":1,\"global_animationduration\":\"900\",\"global_animationdelay\":\"200\",\"global_custom_css\":\"\",\"use_global_width\":\"0\",\"hidden_md\":\"0\",\"hidden_sm\":\"0\",\"hidden_xs\":\"0\",\"acl\":\"\",\"font_family\":\"Oswald\",\"title_text_color\":\"#111\",\"title_margin_bottom\":{\"md\":\"20\",\"sm\":\"\",\"xs\":\"\"},\"title_font_style\":{\"weight\":400},\"global_animation\":\"fadeInRight\"}}]}]}